import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import Experience from '../components/Experience';
import Education from '../components/Education';
import Projects from '../components/Projects';
import Certifications from '../components/Certifications';
import Links from '../components/Links';
import '../assets/css/styles.css';

const Home = () => {
    return (
        <div className="home-container">
            <Header />
            <main className="main-content">
                <section className="intro-section">
                    <h1>GUNAM VARDHAN</h1>
                    <p>
                        Explore my professional journey, including my experience, education, projects, and certifications. 
                        Feel free to connect with me through the provided links.
                    </p>
                </section>
                <section id="certifications" className="certifications-section">
                    <h2>Certifications</h2>
                    <Certifications />
                </section>
                <section id="projects" className="projects-section">
                    <h2>Projects</h2>
                    <Projects />
                </section>
                <section id="experience" className="experience-section">
                    <h2>Experience</h2>
                    <Experience />
                </section>
                <section id="education" className="education-section">
                    <h2>Education</h2>
                    <Education />
                </section>
                <section id="resume" className="resume-section">
                    <h2>Resume</h2>
                    <iframe src="/resume.pdf" width="100%" height="500px" title="Resume Preview"></iframe>
                    <a href="/resume.pdf" download="resume.pdf">Download Resume (PDF)</a>
                </section>
                <section id="links" className="links-section">
                    <h2>Links</h2>
                    <Links />
                </section>
            </main>
            <Footer />
        </div>
    );
};

export default Home;
